import React from 'react'
import './accor.css'
import Api from './api.js'
import AddIcon from '@mui/icons-material/Add';
// import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
const Acc = () => {
  return (
    <>
        <div className='mt-5 text-center div1'>
            <h1 className='heading'>hii</h1>
            {Api.map((curEle) => {
              return(
                <div className="entry">
              <div className='div2'>
              <span><AddIcon /></span>
                <p>{curEle.question} </p>
                <p></p>

              </div>
            </div>
              )
            })}

        </div>
    </>
  )
}

export default Acc

